	//AUDIO FUNCTION

	event_ghoul_talking = function(str){
		//
		hypeDocument.triggerCustomBehaviorNamed('ghoul_GOTO_TALKING');
		text_ghoul.style.visibility = "visible";
		//
		snd_ghoul = new Audio(path + arr_ghoul_snd_talk[Math.ceil(Math.random()*arr_ghoul_snd_talk.length)-1]);
		snd_ghoul.play();
		//
		txt_ghoul.innerHTML = "TATGHOUL SAYS: <br> " + str;
	};

	event_ghoul_boo = function(str){
		hypeDocument.triggerCustomBehaviorNamed('ghoul_GOTO_BOO');
		text_ghoul.style.visibility = "visible";
		//
		snd_ghoul = new Audio(path + arr_ghoul_snd_boo[Math.ceil(Math.random()*arr_ghoul_snd_boo.length)]);
		snd_ghoul.play();
		//
		txt_ghoul.innerHTML = "TATGHOUL HOWLS: <br> " + str;
	};

	event_ghoul_talking_done = function(){
		bool_ghost_introDialogue = false;

		text_ghoul.style.visibility = "hidden";

		hypeDocument.triggerCustomBehaviorNamed('ghoul_GOTO_LEFT');
	};

	//interval called to count down to stop talking, give enough time so that ghoul can play talking animation for a bit, and stop keyboard movement so they read important messages...
	event_int_talkingEnd = function(){

		bool_ghost_talking = true;
		num_ghoul_talking = 5;
		// clear first
		clearInterval(int_ghost_talking);
		//
		int_ghost_talking = setInterval(int_talkingEnd, 500);

	};
	event_ghoul_talking_countdown = function (str){

		event_ghoul_talking(str);
		event_int_talkingEnd();

	};
	//actual interval
	int_talkingEnd = function(){

		//countdown
		num_ghoul_talking -= 1;
		//console.log(num_ghoul_talking);

		//reset, alow them to move again
		if(num_ghoul_talking <= 0){
			clear_int_talking();
		};

	};
	//clear it
	clear_int_talking = function(){
		clearInterval(int_ghost_talking);
		bool_ghost_talking = false;
	};

