	//movement keys
	event_event = function(){
		//always update (especially after load)
		num_x_ghoul = parseInt(ghoul.style.left);
		num_y_ghoul = parseInt(ghoul.style.top);
		//screen bounds (update)
		num_screenWidth = window.innerWidth
			|| document.documentElement.clientWidth
			|| document.body.clientWidth;
		num_screenHeight = window.innerHeight
			|| document.documentElement.clientHeight
			|| document.body.clientHeight;
		//
		//SLEEPING FIRST (HANDLE SLEEPING)
		/*if(bool_ghost_introDialogue){
			hypeDocument.triggerCustomBehaviorNamed('ghoul_GOTO_SLEEP');
		};*/
		//AWAKE AND CAN MOVE
		//check if motion is active bool_ghost_introDialogue
		//if sleeping is true then you have to wake it first before using the keyboard and keys
		if(!bool_ghost_introDialogue && !bool_ghost_talking){
			//left/right
			if(bool_ghost_right || keys[keyCodes.right]){
				num_x_ghoul += num_ghoul_speed;
				ghoul.style.left = String(num_x_ghoul + 'px');
				bool_key_down = true;
				//hide_graphics()
				//
				hypeDocument.triggerCustomBehaviorNamed('ghoul_GOTO_RIGHT');
			}
			if(bool_ghost_left || keys[keyCodes.left]){
				num_x_ghoul -= num_ghoul_speed;
				ghoul.style.left = String(num_x_ghoul + 'px');
				bool_key_down = true;
				//hide_graphics()
				hypeDocument.triggerCustomBehaviorNamed('ghoul_GOTO_LEFT');
			}
			//up/down
			if(bool_ghost_up || keys[keyCodes.up]){
				num_y_ghoul -= num_ghoul_speed;
				ghoul.style.top = String(num_y_ghoul + 'px');
				bool_key_down = true;
				//hide_graphics()
				hypeDocument.triggerCustomBehaviorNamed('ghoul_GOTO_UP');
			}
			if(bool_ghost_down || keys[keyCodes.down]){
				num_y_ghoul += num_ghoul_speed;
				ghoul.style.top = String(num_y_ghoul + 'px');
				bool_key_down = true;
				//hide_graphics()
				hypeDocument.triggerCustomBehaviorNamed('ghoul_GOTO_DOWN');
			}
			//BOUNDS
			//down/up
			if(num_y_ghoul < -num_ghoul_height/2 && !bool_cango_down){
				//
				bool_ghost_down = false;
				//push back (these are sloppy, fix later)
				num_y_ghoul += num_ghoul_speed;
				ghoul.style.top = String(num_y_ghoul + 'px');
			};
			if(num_y_ghoul > num_screenHeight - num_ghoul_height && !bool_cango_up){
				//
				bool_ghost_up = false;
				num_y_ghoul -= num_ghoul_speed;
				ghoul.style.top = String(num_y_ghoul + 'px');
			};
			//right/left
			if(num_x_ghoul > num_screenWidth - num_ghoul_width && !bool_cango_right){
				bool_ghost_right = false;
				//push back
				num_x_ghoul -= num_ghoul_speed;
				ghoul.style.left = String(num_x_ghoul + 'px');
			};
			if(num_x_ghoul < -num_ghoul_width/2 && !bool_cango_left){
				bool_ghost_left = false;
				//push back
				num_x_ghoul += num_ghoul_speed;
				ghoul.style.left = String(num_x_ghoul + 'px');
			};
		};
		//WALK OFF SCREEN TO NEXT SCENE HERE (SAME AS ABOVE, BUT JUST CHANGE SCENE... SET SCENE VALS ON SCENE UPDATE)

		//console.log("I AM HERE DOING BACK AND FORTH BETWEEN THE TWO SCENES TO TEST FOR TRANSITIONS WORKING");

		if(!bool_ghost_introDialogue){
			// >>
			if(num_x_ghoul > num_screenWidth - num_ghoul_width && bool_cango_right && bool_key_down){
				nextScene();
			};
